import { FETCH_BOOKINGS_SUCCESS } from "../actions/types";

const initialState = {
    bookings:[]
};

export default function(state = initialState, action) {
  switch (action.type) {
      case FETCH_BOOKINGS_SUCCESS:
          console.log('---------', action.payload)
        return {
            bookings: action.payload
        }; 
    default:
      return state;
  }
}
